import React,{useState} from 'react';
import {Button,Input} from 'antd';
import {render}  from 'react-dom';
const Inputs= function(props) {
    const [name,setName] = useState('默认值');
    const [content,setContent] = useState('默认值');
    const [url,setUrl] = useState('默认值');
    const [source,setSource] = useState('默认值');
    const [type,setType] = useState('默认值');

    //提交
    const click = () => {
        const data = {name,content,url,source,type}
        fetch ('http://localhost:8070/add',{
            method:'POST',
            body:JSON.stringify(data),
        })
        props.history.replace('/');
    }

    //取消创建返回根目录
    const cancel = () => {
        props.history.replace('/');
    }


    return (
        <div style={{marginLeft:'auto',marginRight:'auto',width:"300px"}}>
            <Input style={{width:250}} style={{marginTop:'30px'}} placeholder="名称" onChange={(e) => {setName(e.target.value)}}/>
            <Input style={{width:250}} style={{marginTop:'30px'}} placeholder="简介" onChange={(e) => {setContent(e.target.value)}}/>
            <Input style={{width:250}} style={{marginTop:'30px'}} placeholder="网址" onChange={(e) => {setUrl(e.target.value)}}/>
            <Input style={{width:250}} style={{marginTop:'30px'}} placeholder="资源" onChange={(e) => {setSource(e.target.value)}}/>
            <Input style={{width:250}} style={{marginTop:'30px'}} placeholder="类型" onChange={(e) => {setType(e.target.value)}}/>
            <div>    
                <Button style={{marginTop:'30px'}} onClick={click} type='primary'>提交</Button>
                <Button style={{marginTop:'30px',marginLeft:'115px'}} onClick={cancel} type='primary'>取消</Button>
            </div> 
        </div>
    )
}
export default Inputs
